import './App.css';
import {useState,useEffect} from 'react'
import axios from 'axios'
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';






function App() {
  const [loggedIn, setLoggedIn] = useState();

  const [openlogin, setOpenlogin] = useState(false);

  const handleClickOpenlogin = () => {
    setOpenlogin(true);
  };

  const handleCloselogin = () => {
    setOpenlogin(false);
  };




useEffect(() => { 
  axios.get("http://localhost:5100/loggedIn").then((res) => {
    setLoggedIn(res.data)
  })
},[loggedIn])











  return (
    <div className="App">
      <div className = "allforum">

        {
          loggedIn ? (
              <h1>you logid in</h1>
          ) : (
            <div>
                <p className = "text1">please regitser or create new account</p>
              <div className = "all-btn">

                <br/>
                <button className = "btn btn-success" style = {{marginRight : "20px"}} onClick = {handleClickOpenlogin}>Login</button>
                <button className = "btn btn-primary">Sign in</button>
              </div>

            </div>
          )
        }






<Dialog open={openlogin} onClose={handleCloselogin} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Subscribe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We will send updates
            occasionally.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloselogin} color="primary">
            Cancel
          </Button>
          <Button onClick={handleCloselogin} color="primary">
            Subscribe
          </Button>
        </DialogActions>
      </Dialog>






      </div>
    </div>
  );
}

export default App;
